import React from 'react';
import '../styles/login.css' // Ensure you have the corresponding CSS file

const Login = () => {
  return (
    <div className="login-card">
      <h1>Login to tria Demo</h1>
      <button className="login-button google">Continue with Google</button>
      <button className="login-button twitter">Continue with X (formerly Twitter)</button>
      <div className="separator">OR</div>
      <button className="login-button metamask">Metamask</button>
      <button className="login-button walletconnect">WalletConnect</button>
      <div className="footer">Powered by Tria</div>
    </div>
  );
}

export default LoginCard;
